import { useState } from "react"
import { useEffect } from "react"
import { Link } from "react-router-dom"
import Swal from "sweetalert2"

function Prodact(){
    const [Data1,setData]=useState([])
    useEffect(()=>{
        Efect()
        
    },[])
    const Efect=()=>{
        fetch("http://localhost:9000/prodact/Edit/${}")
        .then(res=>res.json())
        .then(data=>setData(data));
    }


const Delete=(prodact)=>{
Swal.fire({
title:`Are You sure to Delete ${prodact} ?`,
showCancelButton:true 
}).then((data3)=>{
if(!data3.isconfirmed){
fetch(`http://localhost:9000/prodact/${prodact}`,{
method:"DELETE"
}).then((res)=>res.json())
.then(()=>{Efect()})
}})}

return(
<div className="container  ">
<h2 className="mb-5 pt-4">prodact Page</h2>
<Link to={"/Prodact/Add"} type="button" className="btn btn-success mb-4">Add Prodact</Link>
<table className="table table-striped">
<thead>
<tr>
    <th>ID</th>
    <th>Title</th>
    <th>Price</th>
    <th>Operation</th>
    </tr>
</thead>
<tbody>
    {Data1.map((prodact)=>{
            return(
            <tr key={prodact.id}>
            <td>{prodact.id}</td>
            <td>{prodact.title}...</td>
    <td>{prodact.price}</td> 
   
    <td>   
    <button onClick={()=>Delete(prodact.id)} type="button" className="btn btn-danger  btn-sm">Delte</button>
   <Link to={`/prodact/${prodact.id}`} className="btn btn-info btn-sm">View</Link>
   <Link to={`/prodact/Edit/${prodact.id}`} className="btn btn-primary btn-sm">Edit</Link>
   </td>

            </tr>
            
        )
    })}

</tbody>
</table>
</div>
)
}
export default Prodact

